import React, { useEffect, useState } from 'react';
import ABTestService from '../../services/api';
import { ResponseData } from '../../services/types';

const TestResults: React.FC = () => {
  const [responseData, setResponseData] = useState<ResponseData | null>(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const data = await ABTestService.fetchData(123);
        setResponseData(data);
      } catch (error) {
        // We already logged the error in the service
      }
    };

    fetchData();
  }, []);

  return (
    <div className="container">
      {responseData ? (
        <div>
          <h1>AB Test Results</h1>
          <table className="result-table">
            <thead>
              <tr>
                <th></th>
                <th>Control</th>
                <th>Variant</th>
              </tr>
            </thead>
            <tbody>
              {/* Existing table rows */}
              <tr>
                <td>Test ID</td>
                <td colSpan={2}>{responseData.test_id}</td>
              </tr>
              {/* Add more rows as needed for the new fields */}
            </tbody>
          </table>
          {/* Existing paragraphs */}
          <p>Sample Size: {responseData.sample_size}</p>
          {/* Add more paragraphs as needed for the new fields */}
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
};

export default TestResults;
